import React from "react";

const TituloProducto = () => {
    return (
        <div className='col-12 pt-3'>
            <h1 id='titulo_productos'>Nuestros productos</h1>
            <br />
            <div className="col-12 pt-3">
                <p id='texto1'>Para comenzar, elija su producto favorito.
                    ¿Buscas algo diferente? Póngase en contacto con nosotros aquí para un pedido a medida. </p>
            </div>
        </div>
    );
};

export default TituloProducto;
